import React from 'react';
import NavBarComponent from './components/Navbar/NavBarComponent';
import Home from './pages/Home/Home';

function App() {
  return (
    <Router>
    <div>
      <NavBarComponent/>
      <Home/>
    </div>
    </Router>
  );
}

export default App;
